import React, { Component } from 'react';
import { inject, observer } from 'mobx-react';

@inject('example') @observer
class index extends Component {

    render() {
        console.log(this.props);

        return (
            <div>
                <h1>asdasd</h1>
            </div>
        );
    }
}

export default index;
